import React from 'react';
import bck from "../../img/Backgound-3.png";
import "../../CSS/omni.css";

export default function OmniAbout() {
  return (
    <div className="about" style={{backgroundImage: `url(${bck})`, backgroundRepeat: "no-repeat", backgroundSize: "cover", backgroundPosition: "left top"}}>
        <section className="omni-about-container container">
            <div className="about-block flex">
                <div className="about-dscr flex">

                </div>
                <img />
            </div>
        </section>
    </div>
  )
}
